using HECSFramework.Core;namespace Strategies{	[Documentation(Doc.Strategy, "CompareIntGenericNode with two generic attributes")]	public class CompareIntGenericNode : DilemmaDecision	{		[Connection(ConnectionPointType.In, "<int> A")]		public GenericNode<int> A;		[Connection(ConnectionPointType.In, "<int> B")]		public GenericNode<int> B;		public override string TitleOfNode { get; } = "CompareIntGenericNode";		protected override void Run(Entity entity)		{			if (A.Value(entity) == B.Value(entity))			{				Positive.Execute(entity);				return;			}			else			{				Negative.Execute(entity);				return;			}		}	}}